import {CREATE_DATA, START_PUT_REQUEST} from "../types"

const handlerDataSave = (data)=>{
    
    return {
        type: CREATE_DATA,
        payload: data
    }
}

const start_PUT_RequestServer = ()=>{
    
    return{ 
        type: START_PUT_REQUEST
    }
}


export {handlerDataSave, start_PUT_RequestServer}
